import React from 'react';
import { Line } from 'react-chartjs-2';
import { useLocation } from 'react-router-dom';

const GraphsPage = () => {
  const location = useLocation();
  const tableData = location.state?.tableData || [];
  return (
    <div>
      <h1>tableData</h1>
    </div>
  );
};

export default GraphsPage;
